import React from 'react'
import ImageCard from './ImageCard'

const ImageCardList = (props) => {
    const looper = () => {
      let images = [];
      for (let i = 0; i < 10; i++) {
        images.push(<ImageCard />);
      }
      return images;
    };
    return (
      <div
        className="uk-child-width-1-3@s uk-child-width-1-4@m uk-child-width-1-5@l uk-flex-center uk-grid-small"
        data-uk-grid="masonry: true"
        >
        {looper()}
      </div>
    );
}

export default ImageCardList;
